import react from "react";
import './App.css';
import logo from './logo.jpg';
import icon from './icon.png';

function App() {
  return (
    <div class="container">

    <header class="d-flex flex-wrap justify-content-center py-3 mb-4 border-bottom">
          <a href="/" class="d-flex align-items-center mb-3 mb-md-0 me-md-auto text-dark text-decoration-none">

            <span class="fs-4">
              <img src={logo} widht="500px" height="40px" />
            </span>
          </a>

          <ul class="nav nav-pills">
                <a class="nav-link disabled" href="#" tabindex="-1" aria-disabled="true">Казань</a>
            <li class="nav-item"><a href="#" class="nav-link"> <img src={icon} widht="30px" height="25spx" /></a></li>
          </ul>

        </header>
        <main>
        <div class="row">
          <div class="col">
            1 of 2
          </div>
          <div class="col">
             <img src={icon} widht="30px" height="25spx" />
          </div>
        </div>
     </main>
</div>




  );
}

export default App;
